Let's say: account IDs as uppercase letters ("A", "B", "C" ...) public keys are lowercase letters ("a", "b", "c" ...) nonces are numbers (1, 2, 3 ...) A pool might have group of transactions in the hashmap: transactions: { ("A", "a") -> [1, 3, 2, 1, 2] ("B", "b") -> [13, 14] ("C", "d") -> [7] ("A", "c") -> [5, 2, 3]
} There are 3 accounts ("A", "B", "C"). Account "A" used 2 public keys ("a", "c"). Other accounts used 1 public key each. Transactions within each group may have repeated nonces while in the pool. That's because the pool doesn't filter transactions with the same nonce, only transactions with the same hash. For this example, let's say that transactions are valid if the nonce is even and strictly greater than the previous nonce for the same key. Initialization When .pool_iterator() is called, a new PoolIteratorWrapper is created and it holds the mutuable reference to the pool, so the pool can't be modified outside of this iterator. The wrapper looks like this: pool: { transactions: { ("A", "a") -> [1, 3, 2, 1, 2] ("B", "b") -> [13, 14] ("C", "d") -> [7] ("A", "c") -> [5, 2, 3] }
}
sorted_groups: [], sorted_groups is a queue of sorted transaction groups that were already sorted and pulled from the pool. Transaction #1 The first group to be selected is for key ("A", "a"), the pool iterator sorts transactions by nonces and returns the mutable references to the group. Sorted nonces are: [1, 1, 2, 2, 3]. Runtime adapter pulls 1, then 1, and then 2. Both transactions with nonce 1 are invalid because of odd nonce. Transaction with nonce 2 is added to the list of valid transactions. The transaction group is dropped and the pool iterator wrapper becomes the following: pool: { transactions: { ("B", "b") -> [13, 14] ("C", "d") -> [7] ("A", "c") -> [5, 2, 3] }
}
sorted_groups: [ ("A", "a") -> [2, 3]
], Transaction #2 The next group is for key ("B", "b"), the pool iterator sorts transactions by nonces and returns the mutable references to the group. Sorted nonces are: [13, 14]. Runtime adapter pulls 13, then 14. The transaction with nonce 13 is invalid because of odd nonce. Transaction with nonce 14 is added to the list of valid transactions. The transaction group is dropped, but it's empty, so the pool iterator drops it completely: pool: { transactions: { ("C", "d") -> [7] ("A", "c") -> [5, 2, 3] }
}
sorted_groups: [ ("A", "a") -> [2, 3]
], Transaction #3 The next group is for key ("C", "d"), the pool iterator sorts transactions by nonces and returns the mutable references to the group. Sorted nonces are: [7]. Runtime adapter pulls 7. The transaction with nonce 7 is invalid because of odd nonce. No valid transactions is added for this group. The transaction group is dropped, it's empty, so the pool iterator drops it completely: pool: { transactions: { ("A", "c") -> [5, 2, 3] }
}
sorted_groups: [ ("A", "a") -> [2, 3]
], The next group is for key ("A", "c"), the pool iterator sorts transactions by nonces and returns the mutable references to the group. Sorted nonces are: [2, 3, 5]. Runtime adapter pulls 2. It's a valid transaction, so it's added to the list of valid transactions. The transaction group is dropped, so the pool iterator drops it completely: pool: { transactions: { }
}
sorted_groups: [ ("A", "a") -> [2, 3] ("A", "c") -> [3, 5]
], Transaction #4 The next group is pulled not from the pool, but from the sorted_groups. The key is ("A", "a"). It's already sorted, so the iterator returns the mutable reference. Nonces are: [2, 3]. Runtime adapter pulls 2, then pulls 3. The transaction with nonce 2 is invalid, because we've already pulled a transaction #1 from this group and it had nonce 2. The new nonce has to be larger than the previous nonce, so this transaction is invalid. The transaction with nonce 3 is invalid because of odd nonce. No valid transactions is added for this group. The transaction group is dropped, it's empty, so the pool iterator drops it completely: pool: { transactions: { }
}
sorted_groups: [ ("A", "c") -> [3, 5]
], The next group is for key ("A", "c"), with nonces [3, 5]. Runtime adapter pulls 3, then pulls 5. Both transactions are invalid, because the nonce is odd. No transactions are added. The transaction group is dropped, the pool iterator wrapper becomes empty: pool: { transactions: { }
}
sorted_groups: [ ], When runtime adapter tries to pull the next group, the pool iterator returns None, so the runtime adapter drops the iterator. Dropping iterator If the iterator was not fully drained, but some transactions still remained. They would be reinserted back into the pool. Chunk Transactions Transactions that were pulled from the pool: // First batch
("A", "a", 1),
("A", "a", 1),
("A", "a", 2),
("B", "b", 13),
("B", "b", 14),
("C", "d", 7),
("A", "c", 2), // Next batch
("A", "a", 2),
("A", "a", 3),
("A", "c", 3),
("A", "c", 5), The valid transactions are: ("A", "a", 2),
("B", "b", 14),
("A", "c", 2), In total there were only 3 valid transactions, that resulted in one batch.

